import { useState, useEffect } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import UKDataData from "./components/UKDataData";
import HungaryData from "./components/HungaryData";
import BothGraph from "./components/BothGraph";
import Nav from "./components/Nav";
import RangeSelector from "./components/RangeSelector";

const App = () => {
  return (
    <BrowserRouter>
      <h1>Blood Pressure Study</h1>
      <Nav></Nav>
      <RangeSelector></RangeSelector>
      <Routes>
        <Route path="/" element={<BothGraph />}></Route>
        <Route path="/female" element={<UKDataData />}></Route>
        <Route path="/male" element={<HungaryData />}></Route>
      </Routes>
      <footer>Milanche_74</footer>
    </BrowserRouter>
  );
};
export default App;
